import React, {Component} from 'react'
import './Register.css'
import {createNewUser} from './Actions/securityActions'
import PropTypes from 'prop-types'
import {connect} from 'react-redux'
import classnames from "classnames"


export default class Register extends Component {

    constructor(){
        super();

        this.state = {
            prenom: "",
            nom: "",
            email: "",
            telephone: "",
            secteur_activite: "",
            disponibilite: "",
            password: "",
            status: "",
            errors: {}
        }
    }

    render() {
        return(
            <div className="login">
                <div className="login-triangle"></div>

                <p className="login-header"><strong>S</strong>kelters</p>

                <form className="login-container">
                    <p><input name="prenom" type="text" placeholder="Prenom" value={this.state.prenom} /></p>
                    <p><input name="nom" type="text" placeholder="Nom" value={this.state.nom} /></p>
                    <p><input name="email" type="text" placeholder="Email" value={this.state.email} /></p>
                    <p><input name="telephone" type="text" placeholder="telephone" value={this.state.telephone}/></p>
                    <p><input name="secteur_activite" type="text" placeholder="Secteur d'activite" value={this.state.secteur_activite} /></p>
                    <p><input name="disponibilite" type="date" placeholder="Disponibilite" value={this.state.disponibilite}/></p>
                    <p><input name="password" type="password" placeholder="Password" value={this.state.password}/></p>
                    <p><input name="status" type="text" placeholder="valide / von_valide / actif" value={this.state.password}/></p>
                    <p><input type="submit" value="SIGN-UP"/></p>
                </form>
            </div>
        );
    }
}
